import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Section3() {
  const [data, setData] = useState(null);

  useEffect(() => {
    // Make a GET request to retrieve data from the server
    axios.get('http://127.0.0.1:8000/votes')
      .then((response) => {
        if (response.data && response.data.id) {
          setData(response.data);
        } else {
          // Handle empty rows or invalid data here
          console.error('Invalid data received:', response.data);
          setData(null);
        }
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
        setData(null);
      });
  }, []);

  return (
    <div className="section">
      <h2>Section 3</h2>
      {data ? (
        <div>
          <p>First Name: {data.first_name || 'N/A'}</p>
          <p>Last Name: {data.last_name || 'N/A'}</p>
          <p>Gender: {data.gender || 'N/A'}</p>
          <p>Size: {data.size || 'N/A'}</p>
          <p>Weight: {data.weight || 'N/A'}</p>
          {data.birthday ? (
            <p>Birthday: {new Date(data.birthday).toLocaleString()}</p>
          ) : (
            <p>Birthday: N/A</p>
          )}
        </div>
      ) : (
        <p>Loading data...</p>
      )}
    </div>
  );
}

export default Section3;
